    setQuestionNumber

}) {
  return (
      <div className="trivia">
      <div className="questions">What is the capital of India?</div>
      <div className="answers">
          <div className="answer wrong">Kolkata</div>
          <div className="answer">Kolkata</div>
          <div className="answer">Kolkata</div>
          <div className="answer">Kolkata</div>
         
      
      </div>
      </div>
  );
}
